        self.label_67.setText(_translate("topicLessonMainWindow", "What is System of Nonlinear Equations"))
        self.label_68.setText(_translate("topicLessonMainWindow", "<html><head/><body><p align=\"justify\">A system of nonlinear equations is two or more equations at least one of which is not a linear equation that are being</p><p align=\"justify\">solved simultaneously.</p><p align=\"justify\">In a nonlinear system one of the equations can be linear but not all of them.</p></body></html>"))
        self.label_113.setText(_translate("topicLessonMainWindow", "<html><head/><body><p><span style=\" font-size:20pt;\">Solution of a System</span></p><p>A solution of a system in two variables is an ordered pair that makes <span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; font-style:italic; text-decoration: underline; color:#ff0000; background-color:#ffffff;\">both</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\"> e</span>quations true. </p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">It is where the two graphs intersect, what they have in common.  </span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">So if an ordered pair is a solution to one equation, but not the other, then it is </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; font-style:italic; text-decoration: underline; color:#ff0000; background-color:#ffffff;\">not</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\"> a solution to the system.</span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">Since we are looking at nonlinear systems, in some cases, there may be more than one ordered pair that satisfies </span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">all equations in the system.</span><br/></p><p><a name=\"type\"/><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">A </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; text-decoration: underline; color:#00da00;\">consistent system</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\"> is a system that has </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#ff0000;\">at least one solution</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; font-weight:600; color:#000000;\">.</span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">An </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; text-decoration: underline; color:#0000ff;\">inconsistent system</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\"> is a system that </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#ff0000;\">has no solution</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\">.</span><br/></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">The equations of a system are </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#ff0000; background-color:#ffffff;\">dependent</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\"> if all the solutions of one equation are also solutions of the other equation </span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\">or they end up being the </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#ff0000;\">same graph</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\">.</span><br/></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">The equations of a system are </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#ff0000; background-color:#ffffff;\">independent</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\"> if they do not share all solutions. </span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\">They can have </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#ff0000;\">one point in common</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000;\">, just not all of them.</span></p></body></html>"))
        self.label_70.setText(_translate("topicLessonMainWindow", "<html><head/><body><p><span style=\" font-size:20pt;\">Nonlinear Equation outcomes</span></p><p>1) a finite number of solutions</p><p>2) no solution</p><p>3) infinite solutions</p></body></html>"))
        self.label_79.setText(_translate("topicLessonMainWindow", "<html><head/><body><p><span style=\" font-size:20pt;\">Finite Number of Solutions</span></p><p><br/>If the system in two variables has one solutions, it is an ordered pair that is a solution to both equations.</p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">In other words, when you put in the values of the ordered pair it makes </span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; font-style:italic; text-decoration: underline; color:#ff0000; background-color:#ffffff;\">both equations true</span><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">.</span><br/></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">Since we are looking at nonlinear systems, there may be more than one ordered pair that satisfies all equations in the system. </span><br/></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">The graph below illustrates a system of two equations and two unknowns that has four solutions.</span></p></body></html>"))
        self.label_85.setText(_translate("topicLessonMainWindow", "<html><head/><body><p><span style=\" font-size:20pt;\">No Solutions</span><br/></p><p>The equations in the system will not have any points in common, in this situation there is no solution.<br/></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">The graph below illustrates a system of two equations and two unknowns that has no solution.</span></p></body></html>"))
        self.label_114.setText(_translate("topicLessonMainWindow", "<html><head/><body><p><span style=\" font-size:20pt;\">Infinite Solutions</span><br/></p><p>If two graphs end up lying on top of each other then there is an infinite number of solutions, and t<span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">hey would end up being </span></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">the same graph, so any solution that would work in one equation is going to work in the other.</span><br/></p><p><span style=\" font-family:\'Arial\',\'Verdana\',\'Helvetica\',\'sans-serif\'; font-size:medium; color:#000000; background-color:#ffffff;\">The graph below illustrates a system of two equations and two unknowns that has an infinite number of solutions.</span></p></body></html>"))
        self.nextPage6Button.setText(_translate("topicLessonMainWindow", "Next"))
        self.label_69.setText(_translate("topicLessonMainWindow", "Substitution Method"))
        self.label_116.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Examples of solving nonlinear equations using Substitution Method.</p></body></html>"))
        self.label_97.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Example 1:</p><p>Solve the nonlinear system:</p><p align=\"center\"><br/>(1) <span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+</span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = 100</span></p><p align=\"center\">(2) <span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> - </span><span style=\" font-size:20pt; font-style:italic;\">y</span><span style=\" font-size:20pt;\"> = 10</span></p><p>Solution:</p><p>- Equation (2) can be written as </p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">y</span><span style=\" font-size:20pt;\"> = 3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">-10</span></p><p><span style=\" color:#ffffff;\">a</span>so that Equation (1) can be written in terms of the variable <span style=\" font-style:italic;\">x</span> alone by substituting y = 3x - 10 of Equation (2)</p><p><span style=\" color:#ffffff;\">a</span>to <span style=\" font-style:italic;\">y</span> in Equation (1).</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+(3x - 10)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = 100</span><br/></p><p>- Use <span style=\" color:#ff0000;\">Perfect square Factorization</span>, when an expression has the general form <span style=\" font-style:italic; color:#00da00;\">a</span><span style=\" font-weight:600; color:#00da00; vertical-align:super;\">2</span><span style=\" color:#00da00;\">+ </span><span style=\" font-style:italic; color:#00da00;\">2ab</span><span style=\" color:#00da00;\"> + </span><span style=\" font-style:italic; color:#00da00;\">b</span><span style=\" font-weight:600; font-style:italic; color:#00da00; vertical-align:super;\">2 </span>we can factor it as <span style=\" color:#00da00;\">( </span><span style=\" font-style:italic; color:#00da00;\">a</span><span style=\" color:#00da00;\"> + </span><span style=\" font-style:italic; color:#00da00;\">b</span><span style=\" color:#00da00;\"> )</span><span style=\" font-weight:600; color:#00da00; vertical-align:super;\">2</span>, </p><p><span style=\" color:#ffffff;\">a</span>thus when an expression has the general form <span style=\" font-style:italic; color:#0000ff;\">a</span><span style=\" font-weight:600; color:#0000ff; vertical-align:super;\">2 </span><span style=\" color:#0000ff;\">- </span><span style=\" font-style:italic; color:#0000ff;\">2ab</span><span style=\" color:#0000ff;\"> + </span><span style=\" font-style:italic; color:#0000ff;\">b</span><span style=\" font-weight:600; font-style:italic; color:#0000ff; vertical-align:super;\">2 </span>we can factor it as <span style=\" color:#0000ff;\">( </span><span style=\" font-style:italic; color:#0000ff;\">a</span><span style=\" color:#0000ff;\"> - </span><span style=\" font-style:italic; color:#0000ff;\">b</span><span style=\" color:#0000ff;\"> )</span><span style=\" font-weight:600; color:#0000ff; vertical-align:super;\">2</span></p><p><span style=\" color:#ffffff;\">a</span>and vice versa.</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+(9</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> - 60</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> +100) = 100</span><br/></p><p>- Move the constant term to the left side to make it equal to zero:</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 9</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> - 60</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> +100 - 100= 0</span><br/></p><p>- Add or subtract the similar terms:</p><p align=\"center\"><span style=\" font-size:20pt;\">10</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> - 60</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> = 0</span></p><p>- Factor out <span style=\" font-style:italic;\">x </span>and 10:</p><p align=\"center\"><span style=\" font-size:20pt;\">10x (</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">- 6)= 0</span></p><p>- Divide both coefficients by 10:</p><p align=\"center\"><span style=\" font-size:20pt; text-decoration: underline;\">10</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> - 6)= 0</span></p><p align=\"center\"><span style=\" font-size:20pt;\">10</span><span style=\" color:#ffffff;\">aaaaaaaaaaaaa</span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> - 6)= 0</span></p><p>Therefore either <span style=\" color:#00da00;\">x = 0</span> or <span style=\" color:#0000ff;\">x = 6</span></p><p>when <span style=\" color:#00da00;\">x = 0</span>, y = 3 (<span style=\" color:#00da00;\">0</span>) - 10<span style=\" font-size:18pt;\"> = -10</span></p><p>when <span style=\" color:#0000ff;\">x = 6</span>, y = 3 (<span style=\" color:#0000ff;\">6</span>) - 10<span style=\" font-size:18pt;\"> = 8</span></p><p>The solution of the system is:</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">S</span><span style=\" font-size:20pt;\"> = {( 0 , -10 } , ( 6 , 8 )}</span></p><p><br/></p></body></html>"))
        self.label_117.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Example 2:</p><p>Solve the nonlinear system:</p><p align=\"center\"><br/>(1) <span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 4</span><span style=\" font-size:20pt; font-style:italic;\">x - y</span><span style=\" font-size:20pt;\"> = 7</span></p><p align=\"center\">(2) <span style=\" font-size:20pt;\">2</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> - </span><span style=\" font-size:20pt; font-style:italic;\">y</span><span style=\" font-size:20pt;\"> = -1</span></p><p>Solution:</p><p>- Equation (2) can be written as </p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">y</span><span style=\" font-size:20pt;\"> = 2x + 1</span></p><p><span style=\" color:#ffffff;\">a</span>so that Equation (1) can be written in terms of the variable <span style=\" font-style:italic;\">x</span> alone by substituting y = 2x + 1 of Equation (2)</p><p><span style=\" color:#ffffff;\">a</span>to <span style=\" font-style:italic;\">y</span> in Equation (1).</p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 4</span><span style=\" font-size:20pt; font-style:italic;\">x - </span><span style=\" font-size:20pt;\">(2x + 1) = 7</span><br/></p><p>- Distribute the negative sign ( - ) to remove the parenthesis.</p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 4</span><span style=\" font-size:20pt; font-style:italic;\">x - </span><span style=\" font-size:20pt;\">2x - 1 = 7</span><br/></p><p>- Move the constant term to the left side to make it equal to zero and subtract the coefficients with the same variables.</p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 2x - 8 = 0</span><br/></p><p>- Factor out the similar variables and coefficients:</p><p align=\"center\"><span style=\" font-size:20pt;\">( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">+ 2 )(3</span><span style=\" font-size:20pt; font-style:italic;\">x -</span><span style=\" font-size:20pt;\"> 4)= 0</span><br/></p><p>Therefore either <span style=\" color:#00da00;\">x = -2</span> or <span style=\" color:#0000ff;\">x = 4/3</span></p><p>when <span style=\" color:#00da00;\">x = -2</span>, y = 2 (<span style=\" color:#00da00;\">-2</span>) + 1<span style=\" font-size:18pt;\"> = </span>-3</p><p>when <span style=\" color:#0000ff;\">x = 4/3</span>, y = 2 (<span style=\" color:#0000ff;\">4/3</span>) + 1<span style=\" font-size:18pt;\"> = </span>8/3 + 3/3 = 11/3</p><p>The solution of the system is:</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">S</span><span style=\" font-size:20pt;\"> = {( -2 , -3 ) , ( 4/3 , 11/3 )}</span></p><p><br/></p></body></html>"))
        self.label_118.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Example 2:</p><p>Solve the nonlinear system:</p><p align=\"center\"><br/>(1) <span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; font-style:italic;\">x - </span><span style=\" font-size:20pt;\">2)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ (</span><span style=\" font-size:20pt; font-style:italic;\">y - </span><span style=\" font-size:20pt;\">1)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = 1</span></p><p align=\"center\">(2) <span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> + 3 </span></p><p>Solution:</p><p>- Equation (2) is already solved so we will use it and subtract similar variables. </p><p align=\"center\"><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; font-style:italic;\">x - </span><span style=\" font-size:20pt;\">2)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ (</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> + 3</span><span style=\" font-size:20pt; font-style:italic;\">- </span><span style=\" font-size:20pt;\">1)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = 1</span><br/></p><p>- Substitute the Equation (2) to Equation (1).</p><p align=\"center\"><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; font-style:italic;\">x - </span><span style=\" font-size:20pt;\">2)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ (</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> +2)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = 1</span><br/></p><p>- Use <span style=\" color:#ff0000;\">Perfect square Factorization</span>, when an expression has the general form <span style=\" font-style:italic; color:#00da00;\">a</span><span style=\" font-weight:600; color:#00da00; vertical-align:super;\">2</span><span style=\" color:#00da00;\">+ </span><span style=\" font-style:italic; color:#00da00;\">2ab</span><span style=\" color:#00da00;\"> + </span><span style=\" font-style:italic; color:#00da00;\">b</span><span style=\" font-weight:600; font-style:italic; color:#00da00; vertical-align:super;\">2 </span>we can factor it as <span style=\" color:#00da00;\">( </span><span style=\" font-style:italic; color:#00da00;\">a</span><span style=\" color:#00da00;\"> + </span><span style=\" font-style:italic; color:#00da00;\">b</span><span style=\" color:#00da00;\"> )</span><span style=\" font-weight:600; color:#00da00; vertical-align:super;\">2</span>, </p><p><span style=\" color:#ffffff;\">a</span>thus when an expression has the general form <span style=\" font-style:italic; color:#0000ff;\">a</span><span style=\" font-weight:600; color:#0000ff; vertical-align:super;\">2 </span><span style=\" color:#0000ff;\">- </span><span style=\" font-style:italic; color:#0000ff;\">2ab</span><span style=\" color:#0000ff;\"> + </span><span style=\" font-style:italic; color:#0000ff;\">b</span><span style=\" font-weight:600; font-style:italic; color:#0000ff; vertical-align:super;\">2 </span>we can factor it as <span style=\" color:#0000ff;\">( </span><span style=\" font-style:italic; color:#0000ff;\">a</span><span style=\" color:#0000ff;\"> - </span><span style=\" font-style:italic; color:#0000ff;\">b</span><span style=\" color:#0000ff;\"> )</span><span style=\" font-weight:600; color:#0000ff; vertical-align:super;\">2</span></p><p><span style=\" color:#ffffff;\">a</span>and vice versa.</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt; font-style:italic;\"> - </span><span style=\" font-size:20pt;\">4x + 4 + </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> + 4x + 4 = 1</span><br/></p><p>- Simplify the equation.</p><p align=\"center\"><span style=\" font-size:20pt;\">2</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">+ 7 = 0</span><br/></p><p>-A. Solve using quadratic formula.</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; text-decoration: underline;\">-</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; color:#00da00;\">b</span><span style=\" font-size:20pt; text-decoration: underline;\"> +/- √</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; color:#00da00;\">b</span><span style=\" font-size:20pt; text-decoration: underline; vertical-align:super;\">2 </span><span style=\" font-size:20pt; text-decoration: underline;\">- 4 </span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; color:#ff0000;\">a</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; color:#0000ff;\">c</span></p><p align=\"center\"><span style=\" font-size:20pt;\">2</span><span style=\" font-size:20pt; font-style:italic; color:#ff0000;\">a</span></p><p>- <span style=\" font-style:italic; color:#ff0000;\">a</span>= <span style=\" font-size:18pt;\">2</span>, <span style=\" color:#00da00;\">b</span> = <span style=\" font-size:18pt;\">0</span>, <span style=\" color:#0000ff;\">c</span> =<span style=\" font-size:18pt;\">7</span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1,2</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; text-decoration: underline;\">-</span><span style=\" font-size:20pt; text-decoration: underline; color:#00da00;\">0</span><span style=\" font-size:20pt; text-decoration: underline;\"> +/- √</span><span style=\" font-size:20pt; text-decoration: underline; color:#00da00;\">0</span><span style=\" font-size:20pt; text-decoration: underline; vertical-align:super;\">2 </span><span style=\" font-size:20pt; text-decoration: underline;\">- 4 (</span><span style=\" font-size:20pt; text-decoration: underline; color:#ff0000;\">2</span><span style=\" font-size:20pt; text-decoration: underline;\">(</span><span style=\" font-size:20pt; text-decoration: underline; color:#0000ff;\">7</span><span style=\" font-size:20pt; text-decoration: underline;\">))</span></p><p align=\"center\"><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span></p><p><span style=\" font-size:20pt;\">- </span>Simplify <span style=\" font-size:18pt;\">√0</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2 </span><span style=\" font-size:18pt;\">- 4 (2(7)).</span></p><p align=\"center\"><span style=\" font-size:20pt;\">√</span><span style=\" font-size:20pt; color:#00da00;\">0</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">- 4 (</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; color:#0000ff;\">7</span><span style=\" font-size:20pt;\">)) = √</span><span style=\" font-size:20pt; color:#00da00;\">0</span><span style=\" font-size:20pt;\"> - 56</span></p><p align=\"center\"><span style=\" font-size:20pt;\">√</span><span style=\" font-size:20pt; color:#00da00;\">0</span><span style=\" font-size:20pt;\"> - 56 = √-56</span><br/></p><p>- Using radical rule <span style=\" font-size:18pt;\">√-a = √-1 √</span><span style=\" font-size:20pt;\">a</span><span style=\" font-size:18pt;\">, </span>and using imaginary number rule<span style=\" font-size:18pt;\"> √-1 = </span><span style=\" font-size:18pt; font-style:italic;\">i</span>. </p><p align=\"center\"><span style=\" font-size:20pt;\">√-56 = √-1 √56</span></p><p align=\"center\"><span style=\" font-size:20pt;\">√-1 √56 = √56</span><span style=\" font-size:20pt; font-style:italic;\">i </span><br/></p><p>- Using prime factorization, exponential rule <span style=\" font-size:20pt; font-style:italic;\">a </span><span style=\" font-size:20pt; font-weight:600; font-style:italic; vertical-align:super;\">b +c</span><span style=\" font-size:20pt; font-style:italic;\">= a </span><span style=\" font-size:20pt; font-weight:600; font-style:italic; vertical-align:super;\">b</span><span style=\" font-size:20pt; font-style:italic;\">a </span><span style=\" font-size:20pt; font-weight:600; font-style:italic; vertical-align:super;\">c</span><span style=\" font-size:18pt; font-style:italic;\">.</span></p><p align=\"center\"><span style=\" font-size:20pt;\">√56</span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt;\">= √2</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">3 </span><span style=\" font-size:20pt;\">* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span></p><p align=\"center\"><span style=\" font-size:20pt;\">√2</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">3 </span><span style=\" font-size:20pt;\">* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt;\">= √2</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">2 </span><span style=\" font-size:18pt;\">*</span><span style=\" font-size:20pt;\">2* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span><br/></p><p>- Using radical rule <span style=\" font-size:18pt;\">√</span><span style=\" font-size:20pt; font-style:italic;\">ab</span><span style=\" font-size:18pt;\"> = √</span><span style=\" font-size:20pt; font-style:italic;\">a</span><span style=\" font-size:18pt;\"> √</span><span style=\" font-size:20pt; font-style:italic;\">b </span>as long as,<span style=\" font-size:20pt; font-style:italic;\">a</span><span style=\" font-size:18pt;\"> &gt;= </span><span style=\" font-size:20pt;\">0</span><span style=\" font-size:18pt;\">, </span><span style=\" font-size:20pt; font-style:italic;\">b</span><span style=\" font-size:18pt;\"> &gt;= </span><span style=\" font-size:20pt;\">0</span>.</p><p align=\"center\"><span style=\" font-size:20pt;\">√2</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">*2* 7 =√2</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">√2* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span><br/></p><p>- Using radical rule <span style=\" font-size:18pt;\">√</span><span style=\" font-size:20pt; font-style:italic;\">a </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">=</span><span style=\" font-size:20pt; font-style:italic;\"> a,a </span><span style=\" font-size:20pt;\">&gt;= 0.</span></p><p align=\"center\"><span style=\" font-size:20pt;\">√2</span><span style=\" font-size:20pt; font-weight:600; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">√2* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt;\">= 2 √2* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span></p><p align=\"center\"><span style=\" font-size:20pt;\">2 √2* 7</span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt;\">= 2 √14</span><span style=\" font-size:20pt; font-style:italic;\">i </span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1,2</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; text-decoration: underline;\">-</span><span style=\" font-size:20pt; text-decoration: underline; color:#00da00;\">0</span><span style=\" font-size:20pt; text-decoration: underline;\"> +/- 2√14 </span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">i </span></p><p align=\"center\"><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span></p><p>- Seperate the solutions.</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; text-decoration: underline;\">-</span><span style=\" font-size:20pt; text-decoration: underline; color:#00da00;\">0</span><span style=\" font-size:20pt; text-decoration: underline;\"> + 2√14</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">i</span><span style=\" font-size:20pt; color:#ffffff;\">aaa</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">2</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; text-decoration: underline;\">-</span><span style=\" font-size:20pt; text-decoration: underline; color:#00da00;\">0</span><span style=\" font-size:20pt; text-decoration: underline;\"> - 2√14</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">i</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaaaa</span><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaaaaaaa</span><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; color:#ffffff;\">aaa</span><br/></p><p>- Cancel the common factor and factor out <span style=\" font-size:18pt;\">√14.</span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; text-decoration: underline;\">-</span><span style=\" font-size:20pt; text-decoration: underline; color:#00da00;\">0</span><span style=\" font-size:20pt; text-decoration: underline;\"> +2√14</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">2√14</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaaaa</span><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaaaaa</span><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; color:#ffffff;\">aaaa</span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">2√14</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√14</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaa</span><span style=\" font-size:20pt;\">2(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaa</span><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><br/></p><p>- Apply radical rule <span style=\" font-size:20pt; font-style:italic;\">a = </span><span style=\" font-size:18pt;\">√</span><span style=\" font-size:20pt; font-style:italic;\">a </span><span style=\" font-size:18pt;\">√</span><span style=\" font-size:20pt; font-style:italic;\">a</span><span style=\" font-size:20pt;\">, </span>and cancel the common factor.: </p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√14</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√2 √7</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaa</span><span style=\" font-size:20pt;\">(</span><span style=\" font-size:20pt; color:#ff0000;\">2</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaa</span><span style=\" font-size:20pt;\">√2 √2</span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√2 √7</span><span style=\" font-size:20pt;\"> = </span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√7</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaaa</span><span style=\" font-size:20pt;\">√2 √2</span><span style=\" font-size:20pt; color:#ffffff;\">aaaaaa </span><span style=\" font-size:20pt;\">√2</span><span style=\" font-size:20pt; color:#ffffff;\">a</span></p><p>The solution of the system is:</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">1 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√7</span><span style=\" font-size:20pt; color:#ffffff;\">aaa</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt; vertical-align:sub;\">2 </span><span style=\" font-size:20pt;\">= </span><span style=\" font-size:20pt; font-style:italic;\">i </span><span style=\" font-size:20pt; text-decoration: underline;\">√7</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaa</span><span style=\" font-size:20pt;\">√2</span><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaaa</span><span style=\" font-size:20pt;\">√2</span><br/></p></body></html>"))
